import React, { Component } from 'react';
import './header.css';
import Acer from '../images/Acer.png'


class Header extends Component {
    constructor(props){
        super(props);

        this.handleLogin = this.handleLogin.bind(this);
        this.handleLaptop = this.handleLaptop.bind(this);
        this.handleComputer = this.handleComputer.bind(this);
    }


    handleLogin(event) {
        console.log("no")
        if(this.props.onClickLogin != null){
            this.props.onClickLogin();
        }
    }

    handleComputer(event) {
        if(this.props.onClick != null){
            this.props.onClick();
        }
    }

    handleLaptop(event) {
        if(this.props.onClick != null){
            this.props.onClick();
        }
    }

    render() {

        return (
            <div className="header">
                <div className="logo">
                    <img src={Acer} alt="Acer"></img>
                </div>
                <div className="header-center">
                    <button className="laptopButton" onClick={this.handleLaptop}> Laptop </button>
                    <button className="computerButton" onClick={this.handleComputer}> Computer </button>
                    <button className="loginButton"  onClickLogin={this.handleLogin}> Login </button>
                </div>
            </div>
        );
    }
}
export default Header;
